function validateEmail(email) {
    var re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    return re.test(email);
}

function testJSON(str) {
	try {
		JSON.parse(str);			
	} catch (e) {
		return false;
	}
	return true;
}

function testError(str, MsgBox, Redirect) {
	try {
		jdata = JSON.parse(str);
		if(typeof jdata.error !== "undefined") {
			if(MsgBox == true) {
				Redirect = Redirect == true ? true : false;
				displayMessageBox(jdata.error, Redirect);
				return true;
			} else {
				return true;
			}
		}
	} catch (e) {
		return false;
	}
}

function displayError(field, data) {
	field.stop().hide(100);
	setTimeout(function() { field.html(JSON.parse(data).error); }, 150);
	field.delay(200).show(100).delay(3000).hide(100);
}

function testRedirect(data) {
	if(testJSON(data)) {
		jdata = JSON.parse(data);
		if(typeof jdata.redirect !== "undefined") {
			window.location.replace(jdata.redirect);
			return true;
		}
		return false;
	}
	return false;
}

function loadContent(url, container, postdata, callback) {
	
	if(typeof postdata === "undefined") postdata = {};
	if(typeof callback !== "function") callback = function() {};
	
	$.post(url, postdata, function(data) {
		if(testJSON(data)) {
			jdata = JSON.parse(data);
			if(typeof jdata.redirect !== "undefined") {
				window.location.replace(jdata.redirect);
			}
		} else {			
			$(container).stop().fadeOut(100).fadeIn(300)
			setTimeout(function() {
				$(container).html(data);				
			}, 100);
			callback();
		}
	});
}